import styled from '@emotion/styled'
import { AppBar, Button, DialogActions, DialogContent, Grid, TextField, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

const Forgot_password = () => {
    
// header for forgot password
    const Capp = styled(AppBar)({
        backgroundColor: "#9B3C21",
      
      })



  return (
    <div>

{/* pang break */}
        <br/>
        <br/>
        <br/>
        <br/>
        <br/>
        <br/>

        {/* Whole container */}
        <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        spacing={2}
        >

            {/* Item container */}
            <Grid item md={8} style={{ width: 700}}>
                
                {/* Header */}
                <Capp position='static'>
                    <Typography variant='h5' margin={2}>Forgot password</Typography>
                </Capp>

                {/* Components */}
                <Grid         
                container
                direction="column"
                justifyContent="center"
                alignItems="center"
                padding={2}
  
                style={
                    {
                        backgroundColor: "white",
                        border: "solid 2px black"
                    }
                }>
                    <form>



                    {/* First Question */}
                    <Grid item>
                        <Typography variant='h6'> Unforgettable experience that you have already forgotten?</Typography>
                        <TextField 
                        multiline 
                        fullWidth 
                        placeholder='Answer this please' 
                        margin='normal'
                        helperText='I dont know'
                        required/>
                    </Grid>

                    {/* Second Question */}
                    <Grid item >
                        <Typography variant='h6'> Something you neglected?</Typography>
                        <TextField 
                        required
                        multiline 
                        fullWidth 
                        placeholder='Answer this please' 
                        margin='normal'
                        helperText='I dont know'/>
                    </Grid>

                                        {/* Second Question */}
                    <Grid item md={3} padding={1}>
                        <Button fullWidth variant='contained'>
                            Submit
                        </Button>

                    </Grid>
                    <Grid item md={3} padding={1}>
                        <Button fullWidth variant='contained'>
                            Cancel
                        </Button>
                    </Grid>

                    </form>



                </Grid>
                
            </Grid>

        </Grid>
          
    </div>
  )
}

